import Header from '../components/Header.js'
import Link from 'next/link'
import { Component } from "react";

class HomePage extends Component {
  render() {
    return (
      <main>
        <Header />
        <h1>Magic 8 Ball</h1>
      </main>
    )
  }
}

export default HomePage;
